{"username": "posties", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1411927854.07}, "content": "<p style=\"text-align: left;\"><b>\u2022 What is <a href=\"http://Posti.es?\u00a0\" target=\"_blank\">Posti.es?</a></b></p><p style=\"text-align: left;\"><a href=\"http://Posti.es\" target=\"_blank\">Posti.es</a> lets you create instant one-page websites.</p><p style=\"text-align: left;\"><br></p><p> </p><p style=\"text-align: left;\"><b>\u2022 Is it really instant?   </b></p><p style=\"text-align: left;\">Yes. </p><p style=\"text-align: left;\"><br></p><p><b>\u2022 I want to use my own domain with <a href=\"http://Posti.es\" target=\"_blank\">Posti.es</a>, how do i set it up</b>?</p><p><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">\u2780</span>&nbsp;Go to your web hotel</p><p><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">\u2781</span>&nbsp;Log in and find your DNS-settings</p><p><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">\u2782</span>&nbsp;Set your domain to redirect to your Postie-adress!</p><p style=\"text-align: left;\"><br></p><p style=\"text-align: left;\"><b>\u2022 What have you done to make the process instant? </b></p><p style=\"text-align: left;\"><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">You start off with an already good looking design. Then customization is simple. Chose from the fonts we\u2019ve carefully pre-screened and pick the colours you\u2019d like. Finally, adding content is as easy as writing a status on Facebook or posting an image to Instagram.</span><br></p><p style=\"text-align: left;\"><br></p><p style=\"text-align: left;\"><b>\u2022 What if i want subpages?</b></p><p style=\"text-align: left;\"> Consider if you really need subpages! Think about it: how often do you actually bother to use the navigation on the web pages you frequent?</p><p style=\"text-align: left;\"><br></p><p style=\"text-align: left;\"><b>\u2022 I want to request a feature, report a bug or just talk to you.</b></p><p style=\"text-align: left;\"><b></b>Please do! Send a mail to <a href=\"mailto:hello@posti.es\" target=\"_blank\"></a>.&nbsp;We\u2019d love hearing what you think. </p><p style=\"text-align: left;\"><br></p><p style=\"text-align: left;\">\u2022 <b>I want to use a certain font on my webpage that you don\u2019t support.</b></p><p style=\"text-align: left;\"> Please tell us. If it\u2019s a free font from a place like Google fonts chances are good we\u2019ll implement it. If it\u2019s a paid font, however, chances are small.  </p><p style=\"text-align: left;\"><br></p><p style=\"text-align: left;\"><b>\u2022 I want to stay up to date about <a href=\"http://Posti.es.\u00a0\" target=\"_blank\"></a></b></p><p style=\"text-align: left;\">We'll send you carefully selected news about <a href=\"http://Posti.es\" target=\"_blank\"></a> through our <a href=\"http://eepurl.com/2Z1av\"></a>. More frequent news are available through <a href=\"http://www.posti.es/by/posties\"></a>.</p><p style=\"text-align: left;\"><br></p><p style=\"text-align: left;\"><b>\u2022 You're using the \".es\"-domain \u2013 are you in any way affiliated with the Kingdom of Spain?</b></p><p style=\"text-align: left;\">Nope.</p>", "type": 0, "id": "0e3d076e-0ba0-4a64-a472-58e1f9a51fb3", "sortrank": 17},

{"username": "teok", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1415993598.255}, "content": "<p><br></p><p>The Edge of Knowledge (TEOK) is an informal lecture series, where uncommon, unexpected topics are presented in someone\u2019s living room. Short presentations are interspersed with video breaks and drinks, with topics ranging from food to the cosmos, internet memes and personal obsessions, seeking to offer an alternative look at the cultural outputs of the contemporary \u2013 and a window into the fantastic, rich ensemble of people that live and work in Basel. We\u2019re excited to organize and promote this event series \u2013 and if you are around Basel, or anywhere else, you should join us for one of our sessions!</p><p>The series was conceived in early 2014 by <a href=\"http://verasacchetti.net/\">Vera Sacchetti</a>, <a href=\"http://www.joarnot.es\">Juan Palencia</a> and <a href=\"http://tutilifrutero.tumblr.com\">Marta Col\u00f3n</a>.</p><p style=\"text-align: center;\"><a href=\"http://teok.info/madrid\"></a></p>", "type": 0, "id": "0fa9d3df-26c1-45b3-bc53-5e79d9e17455", "sortrank": 1},

{"username": "postiesblog", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1414615068.051}, "content": "<p><i>2014-10-29</i></p><p><br></p><p>Have a look at her AAA+ art on <a href=\"http://www.malingabriella.com\">www.malingabriella.com</a>.</p><p><br></p><p><b>\u2022 Can you tell us about your art?</b></p><p>I work mostly with painting, collage and sculpture. My work becomes the place where inner and outer worlds meet and it's about the tension that emerges between them. I try to balance on the threshold between day and night..</p><p><br></p><p><b>\u2022 You\u2019re only 26 years old, but you\u2019ve already done at least 26 exhibitions. How\u2019d you do it? </b></p><p>Hmm, well it just started at some point and then it\u2019s like a snowball effect I guess \u2013 I love to work with what I do, or I can't imagine not doing it, so I\u2019m just really thankful.</p><p><br></p><p><b>\u2022 How are you using <a href=\"http://Posti.es\" target=\"_blank\">Posti.es</a>?</b></p><p>I\u2019m using it for my website! I love that it is so simple and you can\u2019t get lost.</p><p><br></p><p><b>\u2022 What\u2019s next in store for you?</b></p><p>I have two upcoming solo exhibitions in spring, one at Gallery Steinsland Berliner and one at Ahlbergshallen in \u00d6stersund. Really looking forward!</p>", "type": 0, "id": "137fd1e0-bd4b-433f-84ac-59112887aa26", "sortrank": 5},
{"username": "teok", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1417198315.517}, "content": "<p><b>TEOK #8</b></p><p>TASTE &amp; SAUSAGES</p><p>21.10.2014 dornacherstrasse Basel</p><p>#8.1 - Taste</p><p>David Gregori</p><p>We eat, all the time, at least once a day, and sometimes not very selectively. A closer look to the food in our mouth.</p><p>#8.2 - <a href=\"https://drive.google.com/file/d/0B-tDwevrHDL5Y2d3cTh5OXZXeXc/view?usp=sharing\">Sausagiety</a></p><p>Matylda Krykowski</p><p>Sausagiety deals with persistent interpersonal relationships, and is a social grouping sharing the same social territory. Sausagiety addresses dominant cultural facts and expectations.</p>", "type": 0, "id": "13802130-0faf-4978-9b0f-4b235527733c", "sortrank": 12},

{"username": "djaeken", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1423755045.935}, "content": "Hej. <br><p><br></p><p>Jag skriver med anledning av romerna. N\u00e4r jag f\u00f6rs\u00f6ker hitta information om vad ni tycker att vi ska g\u00f6ra f\u00f6r att f\u00f6rb\u00e4ttra deras situation hittar jag listor p\u00e5 vad varje parti tycker; vissa av er tycker att vi ska s\u00e4tta press p\u00e5 Rum\u00e4nien, andra att var och en av EU:s medlemsstater m\u00e5ste ta ansvar f\u00f6r de romer som befinner sig i landet i fr\u00e5ga. </p><p><br></p><p>Det \u00e4r uppenbart att ni inte \u00e4r \u00f6verens, men helt \u00e4rligt: <br></p><p>Jag bryr mig inte. <br></p><p><br></p><p>F\u00f6r som ni f\u00f6rmodligen har m\u00e4rkt sitter det numera tusentals m\u00e4nniskor i svenska sn\u00f6drivor vinter efter vinter, och vi f\u00e5r knappt h\u00f6ra om n\u00e5gra politiska initiativ f\u00f6r att l\u00f6sa detta. Vinter efter vinter har de suttit d\u00e4r nu, utan att n\u00e5gonting blivit b\u00e4ttre. De blir fler och fler, medan vi som g\u00e5r f\u00f6rbi dem k\u00e4nner oss maktl\u00f6sare och maktl\u00f6sare. Ingen vinner p\u00e5 detta.<br></p><p><br></p><p>Genom er tystnad \u00e4r det som h\u00e4nt nu f\u00f6ljande:<br></p><p>Ansvaret f\u00f6r dessa m\u00e4nniskors \u00f6verlevnad tycks, eftersom ingen fr\u00e5n politiskt h\u00e5ll tar n\u00e5got s\u00e5dant, ha hamnat p\u00e5 medborgarna. \u00c4r det verkligen s\u00e5 en v\u00e4lf\u00e4rdsstat ska fungera \u2013 att folkvalda politiker t\u00e4nker sig att l\u00f6sningen p\u00e5 denna och liknande situationer ligger i att lita till medborgarnas inneboende och spontana generositet? Om det var s\u00e5 att denna generositet nu var s\u00e5 v\u00e4lutvecklad skulle vi ju inte beh\u00f6va det som i folkmun brukar kallas f\u00f6r \"skatt\".<br></p><p><br></p><p>F\u00f6rutom det uppenbart problematiska i att v\u00e4lf\u00e4rdsstaten i st\u00e4llet f\u00f6r att ta hand om dem som befinner sig inom dess gr\u00e4nser \u00f6verl\u00e5ter detta p\u00e5 sina medborgare, finns allts\u00e5 ett annat tydligt problem med detta. N\u00e4mligen att det inte n\u00f6dv\u00e4ndigtvis \u00e4r de b\u00e4st bemedlade som delar med sig av sina pengar. Systemet f\u00f6r att omf\u00f6rdela resurserna faller allts\u00e5.<br></p><p><br></p><p>Man h\u00f6r en uppsj\u00f6 argument emot att ge pengar till personerna i fr\u00e5ga: men jag kan ju inte ge till alla, de l\u00e5ter jobbigt, de skriver d\u00e5ligt, de \"hittar p\u00e5\" att deras barn har leukemi, de \"l\u00e5tsashaltar\" ... Listan kan g\u00f6ras l\u00e5ng, men att anta att m\u00e4nniskor med ett b\u00e4ttre alternativ skulle <i>v\u00e4lja</i> att \"l\u00e5tsashalta\" runt i sn\u00f6modd, med en krycka i ena handen och en halvtom pappersmugg i den andra, och upprepa samma slitna fraser om och om igen \u00e4r ju b\u00e5de bef\u00e4ngt och fantasil\u00f6st. Dessutom verkar det ju knappast vara en lukrativ syssels\u00e4ttning. Jag t\u00e4nker mig dock att merparten av dessa argument<i> </i>handlar om f\u00f6rsvarsmekanismer sprungna ur d\u00e5ligt samvete och maktl\u00f6shet (f\u00f6rutom i de fall de handlar om rasism d\u00e5), och ingen av dessa k\u00e4nslor \u00e4r s\u00e4rskilt trevliga. Som sagt: ingen vinner p\u00e5 detta. <br></p><p><br></p><p>Personligen k\u00e4nde jag redan f\u00f6r ett par \u00e5r sen att situationen var oh\u00e5llbar, att jag inte visste hur jag skulle hantera att jag under en vanlig dag alltid m\u00f6tte samma fem-tio personer (samtliga romer) som bad mig om pengar. S\u00e5 jag best\u00e4mde mig f\u00f6r att EN rom var mitt ansvar, n\u00e4mligen han som jag g\u00e5r f\u00f6rbi varje dag vid pendelstationen. Sen dess sparar jag mina f\u00e5 kronor till honom, och vi h\u00e4lsar alltid varje g\u00e5ng jag g\u00e5r f\u00f6rbi.<br></p><p><br></p><p>Dessutom har detta nu g\u00e5tt s\u00e5 l\u00e5ngt att v\u00e5ra hederliga, svenska gamla tiggare har b\u00f6rjat skriva just att de \u00e4r hederliga, svenska gamla tiggare p\u00e5 sina skyltar: Hej, jag heter Micke, jag \u00e4r svensk, har diabetes och inga pengar till medicin. S\u00e5 helt pl\u00f6tsligt har vi inte bara en situation d\u00e4r medborgarna \u00e4r ansvariga f\u00f6r att omf\u00f6rdelningen av resurser sker, utan dessutom ett vi-och-dom-t\u00e4nk som drabbar tv\u00e5 av de mest utsatta grupperna i samh\u00e4llet: utl\u00e4ndska tiggare och svenska tiggare. Jag t\u00e4nker inte f\u00f6rs\u00f6ka s\u00e4ga n\u00e5got om vem det \u00e4r mest synd om.</p><p><br></p><p>Min po\u00e4ng \u00e4r hur som helst f\u00f6ljande: Jag \u00e4r tr\u00f6tt p\u00e5 att se dessa lidande m\u00e4nniskor sitta i sn\u00f6drivor, f\u00f6rmodligen utan n\u00e5got som helst hopp om en ljusning. Och jag \u00e4r tr\u00f6tt p\u00e5 att sj\u00e4lv ha d\u00e5ligt samvete f\u00f6r att jag inte kan hj\u00e4lpa dem. Och jag \u00e4r tr\u00f6tt p\u00e5 att jag inte h\u00f6r n\u00e5gonting om hur och n\u00e4r detta ska bli b\u00e4ttre genom politiska beslut. Var \u00e4r debatten?<br></p>", "type": 0, "id": "1cdaf954-da42-426e-9ac4-91cd3dc1f063", "sortrank": 1},

{"username": "raquelpisetta", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1421934895.499}, "content": "<p style=\"text-align: center;\">I'm a User Experience Designer currently working as freelance. It's always fun for me to develop Mockups, Wireframes, User Journeys and Interactive Prototypes.</p><p style=\"text-align: center;\"><br></p><p style=\"text-align: center;\">Over the last ten years I have been working with marketing, advertising and graphic design. I started as an Art Director until I fell in love with User Experience Design. </p><p style=\"text-align: center;\"><br></p><p style=\"text-align: center;\">I am a team player and I always embrace collaboration within teams. In my work, I have been in touch with Interaction Design, User Research, Visual Design, Web Development and Agile Methodologies. I do my best to be humble and learn more everyday.</p>", "type": 0, "id": "3b3d67c4-c584-4029-a6d2-18fd7b1aaf7b", "sortrank": 3},
{"username": "alexanderhadley+wwf", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1417683672.896}, "content": "<p>WWF came to Hyper Island for a introductory client brief to the Hyper Island way for us. The issue was that they needed to keep more of their current donors due to an increasing drop-out rate and the decreasing amount of younger people donating.</p><p>During the week-long project with WWF me and my group came up with the concept ActionShop.</p>", "type": 0, "id": "3b5b0002-eb40-4c22-b071-27e737b01bb9", "sortrank": 2},

{"username": "henrikkanekrans", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1425984044.505}, "content": "<b>Passions and expertise</b><br><p><br></p><p>Passionate about working with entrepreneurs in the digital media, publishing, distribution, platforms space.</p><p><br></p><p>Building teams, leading and executing growth projects with ambitious sales &amp; marketing targets.</p><p><br></p><p>Like to drive new business and product development within a growth and/or ambitious company setting.</p><p><br></p><p>Currently founder of start-ups <a href=\"http://www.artworksjournal.com\">Artworks AB</a> and <a href=\"http://www.spellmarket.com\">Spellmarket AB</a>.<br></p><p><br></p><p><b>Previous experiences</b><br></p><p><br></p><p>10+ years in traditional and digital media, fast growing start-up, 7 yrs. in gen. management.</p><p><br></p><p>Founder and CEO Raconteur Media Ltd, Founder &amp; Commercial Director MamabIQ, Mediaplanet CEO Poland, Mediaplanet Business Development Director UK, Mediaplanet Head of webTV UK, Analyst Nordea Corporate Finance, Project  manager <a href=\"http://Financialhearings.com\" target=\"_blank\">Financialhearings.com</a>.</p><p><br></p><p>International experience from the UK, USA, Poland and Scandinavia. </p><p><br></p><p>P&amp;L, headcount (up to 8 direct reports, up to 30 staff), sales growth, marketing, forecasting, business plans &amp; development, financial valuation.</p><p><br></p><p><b>Achievements of which I'm excited<br></b></p><p><br></p><p>Winner Young Entrepreneur of the Year 2010. Start-ups Awards. UK</p><p><br></p><p>Finalist Young Entrepreneur of the Year 2011. Fast Growth Business Awards. UK</p><p><br></p><p>My company <a href=\"http://www.raconteur.net\">Raconteur</a> shortlisted as New Brand of the Year 2011, Marketing Society's Awards for Excellence</p><p><br></p><p>Mediaplanet Poland which I solely set-up and launched was at the time the most successful Mediaplanet launch, out of 16 previously launched countries. \u20ac600,000 profits in first 6 months</p><p><br></p><p>Awarded Entrepreneurship Scholarship from Danderyds Municipality at the age of 15 for company JUSIT HB, tailor-made ties and other profile products.<br></p><p><br></p><p>Launched webTV at Mediaplanet in 2005/2006</p>", "type": 0, "id": "431d1f0d-823f-4df8-8760-a69fd4aea0f5", "sortrank": 1},

{"username": "posti.es/alexanderhadley/wwf", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1417615328.286}, "content": "<p>WWF came to Hyper Island for a introductory client brief to the Hyper Island way for us. The issue was that they needed to keep more of their current donors due to an increasing drop-out rate and the decreasing amount of younger people donating.</p><p>The issues we identified was that younger people don't have an as stable economy and that they there fore saw a monthly payment of ex. 100 SEK a month was something that they in the near future might not come to afford. </p><p>During the week-long project with WWF me and my group came up with the concept ActionShop.</p><p>In the ActionShop you could view the earth and click on different projects that WWF were conducting across the globe. When you selected a project that you would like to help you could select items that the project needed and give the project those items, such as food supplies, gear etc.</p>", "type": 0, "id": "457095dd-de9d-42bf-940d-4f885ddb62ae", "sortrank": 0},

{"username": "jaanakristiina", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1413023592.768}, "content": "<p><b>SEXUAL EDUCATION MANUAL FOR&nbsp;<span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">TEACHERS</span></b></p><p><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">The daughter organisation of the swedish political party Feminist Initiativ, Unga Feminister (Young Feminists) decided to investigate the situation of the sexual education of Swedish schools, and try to explore the possibilites that lies with a well functioning such. The <a href=\"http://issuu.com/pressuf/docs/handboken/3?e=10605222/6475142\">handbook below</a> was presented to teachers, with information based on a survey with over 1000 respondents, about where the sexual education is failing today, and how it can be improved.&nbsp;</span></p><p><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\"><br></span></p><p><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">Compiled by Hannah Bergenman and Lisa Palm&nbsp;</span></p><p><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">Design and layout by me, Sandra Bj\u00f6rn and Pernilla Karlsson</span></p>", "type": 0, "id": "46eb4c2a-b7be-4a95-8623-fe03c78e7600", "sortrank": 35},

{"username": "joarnot", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1415989310.735}, "content": "<p><b>BIO</b></p><p><b><br></b></p><p>Juan Palencia de Sarri\u00e1 (Madrid, 1981)</p><p>Works and lives currently in Basel, Switzerland.</p><p><br></p><p><b>ACADEMIC</b></p><p><b><br></b></p><p>2008 - Architect by the ETSA Madrid.</p><p>2008 - Diploma developed at the Aula PFC, directed by Juan Herreros, \u00c1ngel Borrego, Jacobo Garc\u00eda-Germ\u00e1n, Eva Gil and Lina Toro.</p><p>2006 - Scholarship at the TU Wien, Vienna, Austria.</p><p>2006 - Workshop as working method, workshop by Will Alsop, with final qualification of Excellent, Vienna, Austria.</p><p>Win, OSX, Autocad 2D, Revit, Rhinoceros+Vray, CS suite, Office.</p><p>Spanish (materno), English (quite good), Deutsch (gut), Fran\u00e7ais (just le n\u00e9cessaire).</p><p><br></p><p><b>PERSONAL AWARDS</b></p><p><b><br></b></p><p>2009 - Urban Park at Valdebebas, Madrid, in collaboration with Marta Col\u00f3n and Jacobo Garc\u00eda-Germ\u00e1n, proposal low cost void.</p><p>Shortlisted</p><p>2008 - ETSAM, competition for the ETSAM Library logo, with Marta Col\u00f3n, proposal b de borr\u00f3n.</p><p>Special prize</p><p>2007 - Europan 9 in Amsterdam, ND, in collaboration with Marta Col\u00f3n and Natalia Salas, proposal Negen Vingers. </p><p>Finalist</p><p>2006 - Basurama, competiton Yaentukiosko, <a href=\"http://basurama.org/b06/ya_en_tu_kiosko/27.htm\">proposal T\u00fa mismo</a>.</p><p>1st Prize</p><p>2005 - FAD, premis habitacola (Architecture students FAD prize), competiton re-ocupa, con Marta Col\u00f3n and Ana Herruzo, proposal VVD-X.</p><p>Special shortlisted</p><p>2005 - EMV housing competition in Parla, Madrid, in collaboration with estudio carretas, proposal XS-extrasmall</p><p>Shortlisted</p><p>2003 - EMV housing competition in Vallecas, Madrid, Spain, in collaboration with Marta Col\u00f3n and Felipe Gago, proposal waj\u00e1.</p><p>Shortlisted</p><p><br></p><p><b>PROFESSIONAL EXPERIENCE</b></p><p><b><br></b></p><p>2013-now <b>Burckhardt Partners </b>Basel, CH</p><p>2014 - Schindler Campus, Head of design for Bauprojekt+, Ebikon, CH.</p><p>2014 - Baloise HQ competition, Basel, CH.</p><p>2014 - Aarau hospital new laboratory building, competition, Aarau, CH. (first prize)</p><p>2014 - <a href=\"http://www.psp.info/Unternehmen/Portfolio/Aktuelle-Projekte/Grosspeter-Tower/GrosspeterTower_Visualisierung_1_gross.jpg\">Facade concept</a>, 100% photovoltaic facade design and development for the <a href=\"http://www.burckhardtpartner.ch/de/referenzen/items/neubau-buerogebaeude-und-hotel-grosspeter-tower.html\">Grosspeter Tower</a>, under construction to be completed in 2017, Basel, CH. </p><p>2014 - K\u00f6nigsfelden Psichiatric Hospital expansion competition, K\u00f6nigsfelden, CH. (third prize)</p><p><br></p><p>2013 <b>HHF Architects</b>, Basel, CH</p><p><br></p><p>2013 - <a href=\"http://www.hhf.ch/hhf/projects/projects/097-min-max.html\">MIN/MAX</a> Housing competition in Oetlikon, CH.</p><p>2013 - Medela HQ competition, Zug, CH.</p><p>2013 - Testplanung Zentrum Spreitenbach competiton, Spreitenbach, CH.</p><p>2013 - Urban development competition in Luzern, CH.</p><p><br></p><p>2012 <b>Estudio Luis Urculo</b>, Madrid, ES</p><p>2012 - Estudio de la ruina, video. Art direction and production, at <a href=\"https://elranchitomadrid.wordpress.com/\">El Ranchito</a>, Matadero, Madrid, ES.</p><p>2012 - Assistant at the Vitra Boisbuchet summer workshop, France. <a href=\"http://cargocollective.com/luisurculo/BOISBUCHET-2012\">Workshop Camouflage</a>.</p><p>2013 - <a href=\"http://vimeo.com/38283422\">Dear New York</a>, video. Art direction and production for the Zara new flagship store in NY, US.</p><p>2012 - <a href=\"http://www.starck.com/en/architecture/categories/hotels.html#mama_shelter_istanbul\">Mama shelter,</a> wall designs for a hotel by Philippe Starck, Istanbul, TR.</p><p>2012 - <a href=\"http://manyrestaurante.com.br/pt/espaco/\">Many Restaurant</a>, renewal, in association with Luis D\u00edaz Mauri\u00f1o. Rio de Janeiro, BR.</p><p>2012 - Estudies for a light facade in Baku, AZ.</p><p>2012 - Exhibition at <a href=\"http://www.plataformadeartecontemporaneo.com/pac/%E2%80%9Censayo-sobre-una-ruina%E2%80%9D-luis-urculo-en-la-galeria-eva-ruiz/\">Galer\u00eda Eva Ruiz</a>, Madrid, ES.</p><p>2012 - Exhibition at Galeria Dama Aflita, Porto, PT.</p><p><br></p><p>2006, 2009-2012 <b>Langarita-Navarro Arquitectos</b>, Madrid, ES</p><p>2012 - <a href=\"http://www.langarita-navarro.com/project/casa-baladrar/\">Casa Baladrar</a>, single house, concept, development, executive projects and construction phase. Completed in 2013. Alicante, ES.</p><p>2011 - <a href=\"http://www.langarita-navarro.com/project/red-bull-music-academy/\">Red Bull Music Academy / Nave de M\u00fasica Matadero</a> Madrid, warehouse renewal at Nave 15 at Matadero Madrid, schematic design, executive project, construction phase, equipment project and design, Madrid, ES.</p><p><a href=\"http://miesarch.com/index.php?option=com_content&amp;view=article&amp;id=5&amp;Itemid=5&amp;lang=en\">Special Mention Emergent Architect European Union Prize for Contemporary Architecture Mies van der Rohe Award 2013</a></p><p>Premi FAD 2012</p><p>AR+D Emerging Architects Award 2012</p><p>Finalist XII Bienal Espa\u00f1ola de Arquitectura y Urbanismo 2013</p><p>Selected Arquia-Pr\u00f3xima 2012</p><p>2011 - Competition for the YAP MAxxi Museum, proposal <a href=\"http://www.langarita-navarro.com/project/amplifier-rocking-swing/\">Amplifier Rocker Swing</a>, Rome, IT. (Finalists)</p><p>2011 - Collaboration in a project for an office building at the Novartis Campus, Basel, CH.</p><p>2007 - <a href=\"http://www.langarita-navarro.com/project/intermediaeprado/\">Medialab-Prado</a>, contemporary art center. International competiton (1st prize), development, executive project and collaboration though the construction phase, Madrid, ES.</p><p>Winner XII Bienal Espa\u00f1ola de Arquitectura y Urbanismo 2013</p><p>COAM Award 2013</p><p>Sacyr Innovation Award 2014</p><p>2010 - <a href=\"http://www.langarita-navarro.com/project/deposito-de-las-especies/\">Species deposit</a>, new access for Matadero Madrid through its water tower, schematic design, executive project and construction phase. Madrid, ES.</p><p>2010 - <a href=\"http://www.langarita-navarro.com/project/heaven-is-a-truck/\">Lolita</a>, infrastructure for events and meals, roadside restaurant, Zaragoza, ES.</p><p>2010 - <a href=\"http://www.langarita-navarro.com/project/led-action-screen/\">Led Action Facade</a>, urban installation, Madrid, ES.</p><p>2010 - <a href=\"http://www.langarita-navarro.com/project/alejandro/\">Alejandro</a>, exhibition design and construction at the Sala del Dep\u00f3sito del Canal de Isabel II, Madrid, ES.</p><p>2009 - MMM, competition for the exhibition project (1st prize) for the Madrid pavilion at the Shanghai 2010 Word Expo, Shangai, CN.</p><p>2009 - Celebration Park, ludic park, development and schematic project. La Almunia de Do\u00f1a Godina, ES.</p><p>2009 - <a href=\"http://www.langarita-navarro.com/project/casa-doble/\">Casa Doble</a>, singular house, executive project, construction phase, Almonacid de la Sierra, ES.</p><p>2008 - Temporary Space for Medialab Prado, Madrid, ES.</p><p><br></p><p>2009 <b>Fernando Andr\u00e9s Arquitectos</b>, Madrid, ES</p><p>2009 - Multipurpouse building, competition (1st prize). Legan\u00e9s, Madrid, ES.</p><p>2009 - Sport complex, competition (1st prize), Madrid, ES.</p><p><br></p><p>2009 <b>Garc\u00eda-Germ\u00e1n Asociados</b>, Madrid, ES</p><p>2009 - Urban master plan competition for San Sebasti\u00e1n de los Reyes, Madrid, ES.</p><p><br></p><p>2004 <b>Pedro Feduchi</b>, Madrid, ES</p><p>2004 - Dise\u00f1a Madrid, development for the urban furniture competiton, Madrid, ES.</p><p>2004 - Schematic project for a singular house in Madrid, ES.</p><p><br></p><p><b>EXHIBITIONS</b></p><p><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\"><br></span></p><p><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">2010 - ETSAM, Madrid, APFC_asap exhibition, ETSA Madrid, ES.</span></p><p>Diploma model</p><p>2010 - T5 Project Space, Ljubljana, SLO.</p><p>Diploma model</p><p>2009 - El Croquis Museum, Segovia ES.</p><p>Valdebebas urban park proposal model</p><p>2009 - Fundaci\u00f3n COAM, Madrid, ES.</p><p>Valdebebas urban park proposal model</p><p>2005 - FAD, Barcelona, ES.</p><p>Re-Ocupa VVDX proposal</p><p>2004 - CEU Arquitectura Madrid, ES.</p><p>Selected work</p><p>2002 - CEU Arquitectura, ES.</p><p><br></p><p><b>PERSONAL WORK</b></p><p><b><br></b></p><p><b>Architecture</b></p><p>2015 - Renewal of a house in Mallorca, ES.</p><p>2012 - Refurbishment of a cafeteria in La Latina, Madrid, ES.</p><p>2011 - Mobile bar for Mahou at Matadero Madrid, collaboration with Jeronimo Hagerman, development and construction, Madrid, ES.</p><p>2010 - Sun deck garage, with Marta Col\u00f3n, Madrid, completed, Madrid,ES.</p><p>2009 - <a href=\"http://thisisgrey.com/stuff/garciagerman/?p=405\">Low Cost Void</a>, co-authorship with Marta Col\u00f3n and Jacobo Garc\u00eda-Germ\u00e1n for the competition for a new urban park at Valdebebas, Madrid, ES. Shortlisted.</p><p>2009 - Europan 10 housing competition with APFC Studio.</p><p>2008 - Schematic project for a new school at Pozuelo de Alarc\u00f3n, Madrid, ES.</p><p>2007 - Europan 9 housing competition with Marta Col\u00f3n and Natalia Salas, Amsterdam, NL.</p><p>2006 - Intervention at the access of Santa Susana, Barcelona, ES (2nd prize)</p><p>2005 - Europan 8 housing competition with Marta Col\u00f3n, Diego col\u00f3n, Paula Caballero and I\u00f1igo Redondo, Hamar, NO.</p><p>2005 - Housing competition with Marta Col\u00f3n, Diego Col\u00f3n, Paula Caballero, Parla, Madrid, ES. (shortlisted)</p><p>2005 - Competition for 2700 houses, organised by IVIMA, Madrid, ES.</p><p>2003 - Europan 7 housing competition with Marta Col\u00f3n, Diego Col\u00f3n, Paula Caballero, I\u00f1igo Redondo and Francisco Garc\u00eda, Barakaldo, ES</p><p><br></p><p><b>Design</b></p><p>2014 - <a href=\"http://depotbasel.ch/en/2013/11/30/display/\">Display</a> workshop at <a href=\"http://depotbasel.ch/en/\">Depot Basel</a>&nbsp;</p><p>2014 - Website for <a href=\"http://www.zoetvizcaino.com/\">Zo\u00e9 T. Vizca\u00edno</a></p><p>2014 - Website for <a href=\"http://www.holbach.es/\">Holbach</a>. Online.</p><p>2014 - Castillo de Ucero wine labelling, web design. On development.</p><p>2014 -&nbsp;<span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">Artwork for Nave de M\u00fasica <a href=\"http://joarnot.tumblr.com/image/69878582105\">Lecture Department</a>, <a href=\"http://www.mataderomadrid.org/ficha/2535/lecture-department.html\">Matadero Madrid</a>, ES.</span></p><p>2013 - Gocaps, concept design and website.</p><p>2012 - Branding for Cafe Molar, Madrid, ES.</p><p>2012 - Hotel Ayll\u00f3n web design.</p><p>2012 - Wood good web design. Online.</p><p>2012 - Low table design for Espacio Trapezio, Madrid, ES.</p><p>2012 - Logo design for Gunter Gallery, Madrid, ES.</p><p>2011 - Bag design for HJ groceries, Madrid, ES.</p><p>2009 - <a href=\"http://www.martacolon.com/project/b-de-borron/\">Logo</a> for the ETSAM Library (competition), Madrid, ES.</p><p><br></p><p><b>Others</b></p><p>2014 - <a href=\"http://teok.info\">TEOK Basel</a></p><p>The Edge of Knowledge (TEOK) is an informal lecture series in Basel, where uncommon, unexpected topics are presented in someone\u2019s living room. Short presentations are interspersed with video breaks and drinks, with topics ranging from food to the cosmos, internet memes and personal obsessions. The series was conceived in early 2014 and is curated by <a href=\"http://verasacchetti.net/\">Vera Sacchetti</a>, <a href=\"http://tutilifrutero.tumblr.com/\">Marta Colon</a> and myself, seeking to offer an alternative look at the cultural outputs of the contemporary \u2013 and a window into the fantastic, rich ensemble of people that live and work in Basel. We\u2019re excited to organize and promote this event series \u2013 and if you are around Basel or anywhere else, you should join us for one of our weekly sessions! For more information, visit <a href=\"http://teok.info\">TEOK.info</a>, or follow us on <a href=\"https://www.facebook.com/teokbasel\">Facebook</a><a href=\"http://teokbasel.tumblr.com\"></a>, <a href=\"https://www.facebook.com/teokbasel\"></a>&nbsp;or <a href=\"https://twitter.com/teokbasel\"></a><a href=\"http://twitter.com/teokbasel\"></a>.</p><p><br></p><p>Curriculum closed in 10.03.2015 /&nbsp;<span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">More info at <a href=\"http://joarnot.tumblr.com/\"></a>.<a href=\"http://joarnot.es/blog\"></a></span></p>", "type": 0, "id": "4944bbf4-af5f-4101-9298-3d9efc26d579", "sortrank": 1},

{"username": "teok", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1417198348.052}, "content": "<p><b>TEOK #1</b></p><p>NOMA &amp; MONKEYS</p><p>01.04.2014 B59 Basel</p><p>#1.1 - <a href=\"https://drive.google.com/file/d/0B-tDwevrHDL5UDdsdjMyUTZOelcyZkRVS0l6TndvUmhLZ0hr/view?usp=sharing\">NOMA, best restaurant in the world. Fact or Fiction?</a></p><p>Francesco Valente &amp; Aleris Rodgers</p><p>A visual expos\u00e9 of haute, hyper-local nordic cuisine</p><p>#1.2 - <a href=\"https://drive.google.com/file/d/0B-tDwevrHDL5ZnFCbEQ0R1JtOFk/view?usp=sharing\">From Space Monkey to IKEA Monkey</a></p><p>Vera Sacchetti</p><p>The tale of Darwin, a monkey that got lost in a suburban IKEA in Toronto, his furry coat and the internet craze around him.</p>", "type": 0, "id": "4ab26f0c-f8fe-4c4d-a459-074b80eff509", "sortrank": 19},

{"username": "malingabriella", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1414159446.721}, "content": "<p><i>If one called painting by its name, Malin Gabriella Nordin would probably have it&nbsp;<span style=\"font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">respond with the voice of rocks: of stones that fluently speak their own language&nbsp;</span><span style=\"font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">of shapes and ciphers and glow with multiple colours in the dark. Nordin gives&nbsp;</span><span style=\"font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">abstract forms a unique presence that is subtly spooky, animated by the silent&nbsp;</span><span style=\"font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">laughter of beings from other dimensions.&nbsp;</span></i></p><p><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; \u2013 Jan Verwoert, 2013</span></p>", "type": 0, "id": "519b019b-f1c6-4bbb-ba5b-727103bd0aa5", "sortrank": 12},

{"username": "teok", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1417198325.503}, "content": "<p><b>TEOK #6</b></p><p>VIOLIN &amp; RELATIONS</p><p>23.09.2014 farnsburgerstrasse Basel</p><p>#6.1 - <a href=\"https://drive.google.com/file/d/0B-tDwevrHDL5eElmckFnZFY5bjQ/view?usp=sharing\">A personal approach to the violin</a></p><p>Tobias Eglauer</p><p>An attempt to talk about an instrument I can\u2019t play and I don\u2019t really understand.</p><p>#6.2 - <a href=\"https://drive.google.com/file/d/0B-tDwevrHDL5TXJtQUNWRXhjbnpNc3VzTjNkbDNZREdKalhj/view?usp=sharing\">Relations</a></p><p>Vesna Jovanovic</p><p>Recent years have brought upon us the age of the \u2018me\u2019: the self-obsessed, self-defined, narcissistic self. But how did we get here? This lecture explores the many convoluted path to the self, and the many relations that are inextricably linked to our definition of ourselves.</p>", "type": 0, "id": "57f1bd85-38b6-4033-a67c-ddd502d54a64", "sortrank": 14},

{"username": "sister", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1416563612.443}, "content": "<p>11.21.2014 friday 2am</p><p>this is great i cant sleep because of a extremely rich hot chocolate i got from blue bottle at aork this afternoon , and i can type a post in bed on my phone!</p><p><br></p><p>what flow in the sea? is it a pieces thing????!?!?!!? ha ha ha ha</p><p><br></p><p>last week was great, we sleeped in tents for three nights and it felt soooo gooood!! we camped in santa cruz s new brightens beach on wed. it was raining almost the whole night but we got lucky! tent was dry and it was such a good sleep sleeping in the rain keeping warm and cozy inside. i wish i could sleep outside everyday</p><p>we saw \"mac demarco\" played a show in santa cruz, he is really good, really funny pop songs you will like him! hes the new john lennon!! check him out on you tube! type in--&gt;salad days full album</p><p><br></p><p>one picture is from sacramento, we went there on our way back to sf, whitney our friend, is the girl in braids and yellow sweater, she has a yellow house qnd she made the cheesy pumpkin ! and i made it again when i got home , it was so easy and so gooooooood! fuck!</p><p>you cut the pumpkin open, take the seeds out, fill it with gruyere cheese and heavy cream , put some salt and pepper and nutmeg and throw it in the oven until the pumpkin is squishy and cheeses are bubbling. oooo soooo gooood and sooooo fat.</p><p><br></p><p>theres also a pic of the new shop, and the girl w black hat is trinA.&nbsp;</p><p><br></p><p>also my ceramics came out! im so pleased w them i love doing them so much!i made a flower shAped coaster that goes well with my new a dollar fifty clear glass! &nbsp;the question mark plate is for james a pie plate! they dont photograph that well in person is better.</p><p><br></p><p>maybe i should go to sleep now gotta wale up early</p><p><br></p><p>song of the day for you-- my bloody valentine;we have all the time in the world. its on youtube.</p><p><br></p><p>october nothing was happening i almost go crazy this month is the opposite so many things to do and work is picking up which is good.. i gotta update my website its a little outta date ..</p><p><br></p><p><br></p>", "type": 0, "id": "5f94aec2-9f19-4793-84a3-cae4d6174826", "sortrank": 14},

{"username": "teok", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1417198631.13}, "content": "<p><b>TEOK X</b></p><p>DISPLAY</p><p>02.12.2014 <a href=\"http://depotbasel.ch/\">Depot Basel</a></p><p><b style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">\u202a</b><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">#\u200eX\u202c.1 -&nbsp;</span><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">Fenced Nature</span><br></p><p>Basil Th\u00fcring</p><p>With the Head of Geosciences at Basel's Naturhistorisches Museum, an exploration of the diverse and fascinating ways in which exhibits are shown in Natural History Museums.</p><p>#X.2 -&nbsp;<span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\"><a href=\"https://drive.google.com/file/d/0BxFDitZXvhlAWDVLRFNxRFFyWEE/view?usp=sharing\">Displaying the Absurd</a></span></p><p>Pedro Portellano</p><p>Spain's nearly 28.000 roundabouts are big urban displays where you can find some of the most unbelievable pieces of unnecessary contemporary art in the country. This is a curated selection of the best Roundabout Art in Spain.</p><p>#X.3 -&nbsp;<span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\"><a href=\"https://drive.google.com/file/d/0BxFDitZXvhlAU3pvOE5VNkNYc28/view?usp=sharing\">Ecology is Queer</a></span></p><p>B\u00e1rbara Ma\u00e7\u00e3es</p><p>An exploration of ecology, minimalism and representation \u2013 from drawings to land art, poems and environmental interventions \u2013 shedding light onto the many layers of this highly constructed term.</p><p><br></p><p>More about <a href=\"http://depotbasel.ch/en/2013/11/30/display/\">Display</a></p><p><br></p><p>We will be at Depot Basel on the 13.02 presenting the book DISPLAY in which we had the pleasure to collaborate with a text by Vera Sachetti. Read the text&nbsp;<a href=\"https://docs.google.com/document/d/1XAeQmF_VKzvPehZNjIewRUrPU7olq8AFsdXR8qdYIdo/edit\"></a>.</p>", "type": 0, "id": "657d5e12-84a5-40f3-94a2-d83a8e6f56a8", "sortrank": 8},

{"username": "alexanderhadley+taskrunner", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1417695432.117}, "content": "<p>Our solution was to remove the bidding process and instead be able to search for Runners or choose a so called feature Runner who you would offer the task to. A featured Runner was a part of our new concept meaning that a Runner who had a completed profile and very good feedback would then be featured. The featured Runner would then accept or deny the task, we believe that the acceptance rate would be high and therefore the service would be more on-demand and eventually it would be top-of-mind.</p>", "type": 0, "id": "8bb9effa-3b53-49b8-9321-b1347e9d4048", "sortrank": 8},
{"username": "whenindoubtfuckitclub", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1415818555.442}, "content": "<p>Subscription to the club lasts two months (possibly longer if there are more doubts in mind by the end of subscription) and includes ONE monthly surprise package mailed to wherever you desire to reinforce your dedication to fuck it very much, whatever it is.</p><p><br></p><p>*Monthly package might contain: a print, a drawing, a painting, a snack, a functional sculpture, a piece of nature, a shirt, some kind of jewelry or ceramics, a cd or dvd, a foto, a book, etc. Package will be seriously made and put together with intensity and worth your while.&nbsp;</p><p><br></p><p>To join the subscription will cost 50 US dollars. Send an email to <a href=\"mailto:sbscrb2whndbtfckitclub@gmail.com\" target=\"_blank\">sbscrb2whndbtfckitclub@gmail.com</a> to arrange a transaction.</p><p><br></p><p>THIS IS A PRE ORDER due to upcoming traveling plans in Asia. Subscription will start in February 2015 and end in March 2015 ,with a total Two surprise mails.</p><p><br></p><p>(Club name is derived from a John Lennon song from the Anthology boxset ,which is pure gold in music history.)</p><p><br></p><p><br></p><p>All welcomed. Looking forward to seeing you.</p><p><br></p><p>x W.I.D.F.I.C. <br></p><p><br></p>", "type": 0, "id": "8bde1999-83d6-485c-a81f-2cd0ef46a2f7", "sortrank": 1},

{"username": "vintagedaydream", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1418351879.607}, "content": "<p><p><b>ARTIST CV</b></p><p><br></p><p>1986</p><p>Born in North Mankato, Minnesota</p><p>Currently lives and works in Saint Paul, Minnesota</p><p><br></p><p><b>Education</b></p><p><br></p><p>2012 </p><p>Bachelor of Science in Psychology &amp; Studio Art Minor, Minnesota State University, Mankato</p><p><br></p><p><b>Solo Exhibitions</b></p><p>2012&nbsp;May, Discovering a Light in the Dark, Nina\u2019s Coffee Caf\u00e9, Saint Paul, Minnesota<br></p><p>2012 August &amp; September, Taking Flight, Groundswell Coffee, Saint Paul, Minnesota</p><p>2012 October, Everything is Choice &amp; We Are All Connected, Cosmics Coffee, Saint Paul,  Minnesota</p><p>2012 December     Igniting Light, West Side Perk, Bloomington, Minnesota</p><p>2013&nbsp;March, The Ultimate Spring Prosperity Party, Amsterdam Bar + Hall, Saint Paul, Minnesota</p><p>2014&nbsp;July, Love is the Answer, Nina\u2019s Coffee Caf\u00e9, Saint Paul, Minnesota</p><p><b><br></b></p><p><b>Group Exhibitions</b></p><p>2013&nbsp;December, Raging Art On, Gamut Gallery, Minneapolis, Minnesota</p><p><br></p><p><b>Collections</b></p><p><b><br></b></p><p>Works held in private collections in Los Angeles, California; Charlotte, North Carolina; Long Lake, Minnesota; Minneapolis, Minnesota and Saint Paul, Minnesota </p><p><br></p><p><b>Awards</b></p><p>2004, Frederick R. Layton Art Scholarship</p><p><br></p><p><b>Publications</b></p><p>Jarrett, Stephanie. Letters from Saint Paul. Saint Paul: Vintage Daydream, 2013. Print.&nbsp;</p></p>", "type": 0, "id": "951f1529-2832-4c71-97fb-b895f785192d", "sortrank": 16},

{"username": "postiesblog", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1414254027.413}, "content": "<p><i>2014-10-25</i></p><p><br></p><p>Check out her site at <a href=\"http://www.posti.es/by/jaanakristiina\">www.posti.es/by/jaanakristiina</a>. Here\u2019s a sneak peek into her mind:</p><p><br></p><p><b>\u2022 When did you decide you wanted to work with art?</b></p><p>When I realized I was good at it! That people got really wowed by some of my pictures and ideas. And that the wow effect was good to use as a kind of Trojan horse, to sneak in other messages with. And actually, this was really recently, like a year ago! I was studying media- and communication science, but failing almost everything because I spent all my time drawing and painting and interning at a gallery.</p><p><br></p><p><b>\u2022 What are you using <a href=\"http://Posti.es\" target=\"_blank\">Posti.es</a>&nbsp;for?</b></p><p>To put the funny, cool stuff I make on display. But in a way that complements the other social channels i use. <a href=\"http://Posti.es\" target=\"_blank\">Posti.es</a>,&nbsp;i think, will work good as my \"serious\" channel!</p>", "type": 0, "id": "a1eaf68e-5d1d-4827-b0c4-c9aee4051250", "sortrank": 11},

{"username": "lomenosprobable", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1420018836.191}, "content": "<p style=\"text-align: center;\"><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\"><b>Nurit Kasztelan&nbsp;</b></span></p><p style=\"text-align: center;\"><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\"><br></span></p><p style=\"text-align: left;\"><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">Naci\u00f3 en Buenos Aires el 16 de septiembre de 1982. Public\u00f3 </span><span style=\"font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\"><i>Movimientos Incorp\u00f3reos</i></span><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\"> (Huesos de Jibia, 2007), </span><span style=\"font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\"><i>Teoremas </i></span><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">(La propia Cartonera, Montevideo, 2010) y </span><span style=\"font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\"><i>L\u00f3gica de los accidentes</i></span><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\"> (Vox, 2013; Liliputienses, Espa\u00f1a, 2014). Form\u00f3 parte de la antolog\u00eda de dramaturgia </span><span style=\"font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\"><i>Perfecta Anarqu\u00eda volumen I</i></span><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\"> (2011), compilada por Andrea Garrote, con una pieza que luego dirigi\u00f3. Coordin\u00f3 el ciclo de lecturas de poes\u00eda La manzana en el gusano y fue coeditora de la revista virtual <a href=\"http://www.no-retornable.com.ar\">No-retornable</a>. Actualmente codirige la editorial de ensayo Excursiones y <a href=\"http://www.libreriamicasa.com.ar\">tiene una librer\u00eda en su casa.</a></span></p><p><br></p><p><b>&nbsp;\u00bfCu\u00e1les son los contextos de producci\u00f3n de tus escritos? \u00bfTen\u00e9s una rutina para ello?</b></p><p><br></p><p>Para corregir, tengo que tener tiempo libre, pero para escribir, tengo que estar en un estado de disposici\u00f3n mental.  A veces la lectura de un poema, o de un texto, me inspira, a veces un estado de excesiva ebullici\u00f3n interna necesita pasar al papel.  O algo me viene repiqueteando en la cabeza hasta que finalmente lo escribo.</p><p><br></p><p><b>&nbsp;\u00bfCu\u00e1ndo comenzaste a escribir? \u00bfC\u00f3mo describir\u00edas ese momento de incursi\u00f3n?</b></p><p><b><br></b></p><p>A lo que yo considero que es escribir, hace poco. Mi primer poema fue a los once a\u00f1os, pero en los comienzos mi escritura era cat\u00e1rtica. Creo que incluso despu\u00e9s de haber publicado mi primer libro y haberme sacado la ansiedad de encima empec\u00e9 a escribir. </p><p><br></p><p><b>&nbsp;\u00bfCu\u00e1ndo sent\u00eds que un poema comienza a gestarse y cu\u00e1ndo lo das por terminado?</b></p><p><br></p><p>Depende de cada poema, algunos salen de un tir\u00f3n, otros tardan mucho. A veces me preocupa m\u00e1s el ritmo, otras la sintaxis, otras encontrar la palabra adecuada. En general tardo mucho en cerrar poemas, soy lenta para escribir. En mi vida soy acelerada en todo, pero la poes\u00eda me impone otro tiempo m\u00e1s pausado.</p><p><br></p><p>&nbsp;<b>\u00bfQu\u00e9 lugar ocupa la correcci\u00f3n en tu metodolog\u00eda de escritura? \u00bfLes mostr\u00e1s tus textos antes de terminados a otras personas?</b></p><p><br></p><p>La correcci\u00f3n es casi la escritura, lo otro es inspiraci\u00f3n, o suerte. Mostrarle mis poemas a otras personas es imprescindible antes de publicarlos. En mi libro anterior, me ayudaron mucho Eduardo Ainbinder, Sol Echevarr\u00eda, Carlos Battilana, Noe Vera. Este nuevo que estoy escribiendo, que todav\u00eda ni siquiera tiene forma, por ahora solo son poemas agrupados en torno a un eje, s\u00f3lo se lo mostr\u00e9 a Mario Ortiz y a Ver\u00f3nica Viola Fisher y me tiraron unas puntas reveladoras. Y con Julieta Lerman nos fuimos un d\u00eda al tigre a corregir nuestros textos.</p><p><br></p><p><b>&nbsp;\u00bfCre\u00e9s que influyen otras artes, como el cine, la fotograf\u00eda o la m\u00fasica en tu escritura?</b></p><p><br></p><p>Por supuesto, pero influyen como cualquier cosa que te moviliza. No cualquier m\u00fasica ni cualquier pintura. Necesito que me \u201ctoquen\u201d. Sans Soleil, de Chris Marker, es un documental que para m\u00ed es un poema, por ejemplo. Mirar paisajes me influye mucho, estar en el Tigre, cerca del agua, ver florecer mis plantas tambi\u00e9n.</p><p><br></p><p><b>&nbsp;\u00bfParticip\u00e1s en lecturas? Sea afirmativa o negativa tu respuesta, \u00bfc\u00f3mo ves la escena de la poes\u00eda en tu \u00e1mbito local? </b></p><p><br></p><p>S\u00ed, participo en lecturas. Me parece que es una linda instancia para probar poemas nuevos, o para mostrar un libro que una trabaj\u00f3 mucho y quiere ver que le pasa al p\u00fablico con ello. En mi caso, como se me de memoria mis poemas, los recito. En este momento de mi vida, por una cuesti\u00f3n de tiempo, no voy m\u00e1s a lecturas de poes\u00eda; s\u00ed voy a presentaciones de libros de amigos o poetas que me interesen, as\u00ed que no puedo opinar sobre lo que pasa ahora. Me parece que son un buen lugar de difusi\u00f3n y de intercambio, de hecho hace un par de a\u00f1os coordin\u00e9 con un grupo de amigos el ciclo de lecturas de poes\u00eda La manzana en el gusano.</p><p><br></p><p>&nbsp;<b>\u00bfY en concursos? Si es as\u00ed, \u00bfde qu\u00e9 depende tu participaci\u00f3n?</b></p><p><br></p><p>No participo, pero no por nada en especial, sino porque no tengo libro in\u00e9dito ahora para mandar y el otro ya ten\u00eda editor.</p><p><br></p><p><b>&nbsp;\u00bfViaj\u00e1s o te moviliz\u00e1s geogr\u00e1ficamente para participar en eventos po\u00e9ticos? \u00bfCon qu\u00e9 frecuencia?</b></p><p><b><br></b></p><p>Tuve la suerte de ser invitada a varios festivales; Hotel Quequ\u00e9n en Quequ\u00e9n, (2007), Circo Invisible en C\u00f3rdoba, (2008), Feria de Editoriales Autogestionadas en Bah\u00eda Blanca, (2011), Festival Sumergible en Jujuy, (2012) Festival de Poes\u00eda de Ac\u00e1 en Mar del Plata (2013) y el Festival Internacional de Poes\u00eda de Azul, (2013). De afuera, estuve tres veces en Chile, en el III Encuentro de poes\u00eda latinoamericana Poquita Fe, (2008), la Cumbre de poetas Latinoamericanos en Rancagua (2009) y en el Encuentro de poes\u00eda y diversidad (2011); y hace menos de un mes le\u00ed en McNally Mc Jackson en espa\u00f1ol en el Soho, en Nueva York, pero eso fue porque ya estaba ah\u00ed.</p><p><br></p><p><b>&nbsp;\u00bfCu\u00e1les consider\u00e1s tus mayores influencias en este momento?</b></p><p><br></p><p>Me gusta la poes\u00eda que mezcla los g\u00e9neros, como Mario Ortiz y Anne Carson. Enrique Lihn siempre va a estar atr\u00e1s de alg\u00fan poema. Lecturas m\u00e1s cient\u00edficas como Ilya Prigogine o Beno\u00eet Mandelbrot. <i>La gran licencia</i>, el libro de ensayos de John Ashberry.</p><p><br></p><p><b>&nbsp;\u00bfCu\u00e1l es tu postura respecto a los talleres literarios? \u00bfParticip\u00e1s o participaste en alguno, ya sea como asistente o como moderador? \u00bfQu\u00e9 pod\u00e9s referir sobre esa experiencia?</b></p><p><b><br></b></p><p>Hice varios talleres. Con Walter Cassara y Osvaldo Bossi, durante 2 meses, despu\u00e9s casi dos a\u00f1os con Arturo Carrera, de forma individual, y casi cuatro con Alicia Genovese. Aprend\u00ed un mont\u00f3n de cada uno y me parece que los talleres son s\u00faper valiosos. Tambi\u00e9n di y doy talleres de lectura y escritura po\u00e9tica en mi casa y uno de Poes\u00eda para dramaturgos en el Festival Escena. </p><p><b><br></b></p><p><b>&nbsp;\u00bfTen\u00e9s alg\u00fan blog, revista o medio de difusi\u00f3n de poes\u00eda propia o ajena online? Si es as\u00ed, \u00bfcu\u00e1l te parece que es su funci\u00f3n?</b></p><p><b><br></b></p><p>Fui coeditora y directora de la secci\u00f3n de poes\u00eda de la revista virtual No-retornable. Renunci\u00e9 porque estaba haciendo demasiadas cosas, y como dice el dicho \u201ctodo no se puede\u201d. Pero tambi\u00e9n porque sent\u00eda que ya facebook y otros medios daban a difundir poemas todo el tiempo, y no era tan \u00fatil mi funci\u00f3n. </p><p><br></p><p><b>&nbsp;\u00bfHas publicado recientemente o est\u00e1s por publicar? \u00bfCu\u00e1l es tu criterio para elegir una editorial a la que presentarle tus textos?</b></p><p><b><br></b></p><p>Publiqu\u00e9 <i>L\u00f3gica de los accidentes</i> el a\u00f1o pasado por la editorial Bahiense Vox y este a\u00f1o sali\u00f3 en Ediciones Liliputienses, una editorial espa\u00f1ola. </p><p>En mi primer libro, la ansiedad me gan\u00f3 y lo gestion\u00e9 yo, no solo desde el punta de vista econ\u00f3mico, (pagu\u00e9 la edici\u00f3n) sino desde la insistencia en publicarlo. Sufr\u00ed un poco el apuro, porque no estuve muy conforme con el resultado y con el segundo, decid\u00ed que no me iba a pasar lo mismo. Un d\u00eda me escribi\u00f3 por mail Gustavo L\u00f3pez, de la editorial Vox, con quien tengo una muy buena relaci\u00f3n  y que ya hab\u00eda le\u00eddo y conoc\u00eda mis poemas, para preguntarme si ten\u00eda un libro, y decirme que lo quer\u00eda sacar por Vox. Vox me parece una de las mejores editoriales de poes\u00eda que hay as\u00ed que estaba feliz de sacarlo por ah\u00ed. </p><p><b><br></b></p><p><b>&nbsp;Como lector, \u00bfc\u00f3mo hac\u00e9s tu recorte? \u00bfLe\u00e9s contempor\u00e1neos, cl\u00e1sicos, ambos? \u00bfQu\u00e9 otros g\u00e9neros frecuent\u00e1s?</b></p><p><br></p><p>Ambos. Con los contempor\u00e1neos me pasa que los leo m\u00e1s r\u00e1pido, de un tir\u00f3n, oxigenan mi lectura. Los cl\u00e1sicos me demandan m\u00e1s detalle, m\u00e1s atenci\u00f3n, los intercalo. Tambi\u00e9n leo mucha poes\u00eda en ingl\u00e9s. Me gusta mucho leer ensayo, sobre todo sobre poes\u00eda pero tambi\u00e9n filosof\u00eda, novela, cuentos, e incluso teatro. </p><p><br></p><p><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">&nbsp;</span><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\"><b>\u00bfTraduc\u00eds? Si es as\u00ed, \u00bfqu\u00e9 relaci\u00f3n cre\u00e9s que tiene esta tarea con tu producci\u00f3n po\u00e9tica?</b></span><br></p><p><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\"><b><br></b></span></p><p>S\u00ed, traduzco. Me gusta traducir de a dos sobre todo. Traduje del italiano Uomini Miei, de Alda Merini, junto con Mariana Terr\u00f3n y del ingl\u00e9s Meadowlands, de Louise Gl\u00fcck, con Lucia Puppo. En ambos casos tradujimos el libro entero, tarea que nos llev\u00f3 entre dos y tres a\u00f1os, pero por cuestiones de derechos de autor y esas cosas no lo pudimos publicar. Juntos con Julio Ramos tradujimos algunos poemas de Philip Levine y sola traduje cosas sueltas de Anne Carson y Denise Levertov. Ahora me traje de un viaje a Gracey Paley para traducir para m\u00ed.</p><p><br></p><p><b>&nbsp;\u00bfCre\u00e9s en la funci\u00f3n social, o incluso pol\u00edtica, de la poes\u00eda?</b></p><p><br></p><p>La poes\u00eda interrumpe el equilibro, as\u00ed como el amor tambi\u00e9n lo hace. No puedo hablar de funciones.</p><p><br></p><p><b>&nbsp;\u00bfC\u00f3mo imagin\u00e1s a tu lector? \u00bfPens\u00e1s en una idea de lector mientras escrib\u00eds, correg\u00eds o compil\u00e1s?</b></p><p><br></p><p>No imagino a un lector, cosa que no se si est\u00e1 bien, pero es lo que me pasa. S\u00ed soy consciente que en mi libro sent\u00eda que algunos poemas mas \u201cl\u00edricos\u201d, por decirlo de alg\u00fan modo, iban a gustarle m\u00e1s a un grupo de poetas y otros \u201cm\u00e1s objetivistas\u201d a otros. </p><p><br></p><p><br></p>", "type": 0, "id": "b6c231f0-6bf1-4db2-a087-a11fc5160806", "sortrank": 3},

{"username": "teoksantiago", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1427314792.864}, "content": "<p>The Edge of Knowledge (TEOK) es un ciclo de conferencias informales donde temas poco comunes son presentados en el living de una casa. Las charlas son de corta duraci\u00f3n y se combinan con v\u00eddeos y aperitivos. La tem\u00e1tica es variada; desde la cocina al cosmos, memes en internet o cualquier obsesi\u00f3n personal de los expositores invitados. </p><p><br></p><p>Siguiendo la iniciativa puesta en marcha en Basilea y luego en Madrid, contin\u00faa el evento TEOK Santiago. Este ciclo fue concebido en Basilea (Suiza) a principios del 2014 por Juan Palencia, Marta Col\u00f3n y Vera Sacchetti. Persigue ofrecer una mirada alternativa a la producci\u00f3n cultural contempor\u00e1nea y abrir una ventana a todas las personas inquietas con las que compartimos ciudad. </p><p><br></p><p>Estamos orgullosos de organizar y promover estos ciclos, as\u00ed que si est\u00e1s en Santiago de Chile o pasas por aqu\u00ed, te invitamos a que te unas a alguna de nuestras sesiones! </p><p><br></p><p>TEOK Santiago es organizado por&nbsp;<span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">Alicia Arg\u00fcelles Garc\u00eda,&nbsp;</span><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">Tadea de Ipi\u00f1a Mariscal y Nicol\u00e1s Miranda Turu.</span></p><p><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\"><br></span></p><p><a href=\"mailto:teoksantiago@gmail.com\">CONTACTO</a> / <a href=\"http://www.facebook.com/teoksantiago\">FACEBOOK</a> / <a href=\"http://teoksantiago.tumblr.com/\">TUMBLR</a> / MAILING / <a href=\"http://teok.info/\">BASEL</a> / <a href=\"http://teok.info/madrid\">MADRID</a></p>", "type": 0, "id": "b8f8a7fb-a2f7-43af-8ec7-7ea21f5289b5", "sortrank": 1},

{"username": "linear", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1415057494.508}, "content": "<p>Jag har fragment kvar av minnen fr\u00e5n den kv\u00e4llen jag f\u00f6rst satte mig ner och lyssnade igenom ett album av Burial. En d\u00e5 nybliven kamrat(som sjukt nog nu v\u00e4ntar sitt andra barn) hade f\u00e5tt nys om att jag gillade elektronisk musik, och gav mig en l\u00e4nk till <a href=\"http://open.spotify.com/album/4EIUWgEGuue5krjlOSjei2\">'Untrue'</a>. Jag var l\u00e5ngt ifr\u00e5n redo.</p><p><br></p><p>Genom alla mina \u00e5r h\u00e4r p\u00e5 Jorden, s\u00e5 har jag alltid dragit mig undan och s\u00f6kt enslighet men s\u00e4llskap av h\u00f6rlurar n\u00e4r dagarna blir m\u00f6rka- <i>precis som alla andra</i>. Det hade alltid varit att jag fann n\u00e5got att relatera till med den musik jag h\u00f6rde. Vare sig jag fann situationer jag upplevt som jag kunde koppla till det artisten sj\u00f6ng ut om, eller om jag hade minnen kopplade till en vis l\u00e5t- det var en flykt.</p><p><br></p><p><br></p><p>Men sedan s\u00e5 h\u00e4nde n\u00e5got.&nbsp;</p><p>Jag satt d\u00e4r och lyssnade till n\u00e5got helt nytt, och jag fann precis ingenting att k\u00e4nna till det jag nu fick f\u00f6rklarat f\u00f6r mig genom ljud. Hoppl\u00f6st gick jag igenom min bank p\u00e5 k\u00e4nslor och f\u00f6rs\u00f6kte finna n\u00e5gon dammig gammal \u00e5ngestbit att kunna koppla till vad jag nu var st\u00e4lld inf\u00f6r, och det var l\u00f6nnl\u00f6st.</p><p><br></p><p>Jag fick f\u00f6r f\u00f6rsta g\u00e5ngen upplev hur det \u00e4r n\u00e4r musiken tar en iv\u00e4g p\u00e5 en resa som du inte skall ha n\u00e5gon kontroll eller aning om vilken kurs den \u00e4r p\u00e5, och det \u00e4ndrade hur jag lyssnade p\u00e5 musik helt och h\u00e5llet.</p><p><br></p><p><br></p><p>Och det \u00e4r just det som s\u00e4kerligen \u00e4r det klyschiga som sagts ett antal g\u00e5nger om Burials musik, men det \u00e4r verkligen stycken av k\u00e4nslor som har packats in i papper av \u00e5ngest och fr\u00e5gest\u00e4llningar man inte v\u00e5gar prata om vid middagsbordet.</p><p>Var g\u00e5ng jag h\u00f6r en l\u00e5t kan min upplevelse vara helt olik den tidigare, och bitar jag f\u00f6rut kunde uppleva en akut och beh\u00f6vlig dipp till kan numer f\u00f6r mig vara emotionellt st\u00e4rkande och peppande.</p><p><br></p><p>Och det \u00e4r lite s\u00e5 jag k\u00e4nner nu n\u00e4r jag f\u00f6r femte g\u00e5ngen lyssnar igenom <a href=\"http://open.spotify.com/track/1GHApeEwlDhCHKNRXKGyUD\">\"Burial - Lambeth\"</a>&nbsp;<a href=\"https://www.youtube.com/watch?v=gI8Gft90-wc\"></a>. Det har varit minst sagt intressant men \u00e4ven lite l\u00e4skigt hur min tankeg\u00e5ng har g\u00e5tt de senaste 20 minutrarna.</p><p><br></p><p><br></p><p>\u00c4ven om man hade lyssnat p\u00e5 detta sp\u00e5ret utan att ha n\u00e5gon aning om vad det var, s\u00e5 hade man kunnat uppfatta vad man hade st\u00e4llts inf\u00f6r r\u00e4tt omg\u00e5ende. Det kan ses som lite trist, men jag tycker det \u00e4r <b>tryggt</b>.&nbsp;</p><p>Alla elementen jag v\u00e4ntar mig av en produktion fr\u00e5n honom \u00e4r d\u00e4r, men f\u00f6r f\u00f6rsta g\u00e5ngen p\u00e5 en stund s\u00e5 \u00e4r det n\u00e5got som k\u00e4nns mer som en faktisk l\u00e5t \u00e4n ett stycke.&nbsp;</p><p>Jag f\u00e5r inte samma filmiska k\u00e4nsla som n\u00e4r jag h\u00f6r <a href=\"http://open.spotify.com/track/6xEEx7zSBI606gFMIvYwxQ\"></a>&nbsp;eller <a href=\"http://open.spotify.com/track/5ftKi1XWbwGv5J6ZZ4WjPF\"></a>, men det \u00e4r ingen besvikelse alls.&nbsp;</p><p>En genomg\u00e5ende harmonik som direkt s\u00e4tter dig i k\u00e4nslan som om du har en s\u00e5dan d\u00e4r l\u00f6rdag d\u00e4r precis allting k\u00e4nns fel och du vill mest bara f\u00f6rsvinna in i en dimma av k\u00e4nslor.</p><p><br></p><p>M\u00f6rkt? Ja, det m\u00e5 det vara- <i>men s\u00e5 m\u00e5ste det vara.</i></p><p>K\u00e4nslor och sm\u00e4rta \u00e4r menade att k\u00e4nnas, och det m\u00e5ste den f\u00e5 g\u00f6ra.&nbsp;</p><p><br></p><p><br></p><p><br></p>", "type": 0, "id": "bdb2ff7f-527c-4298-84f5-c41a0a76e586", "sortrank": 3},

{"username": "teok", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1425332260.328}, "content": "<p><b>TEOK #12</b></p><p>FUNK&amp;AFRICANNEWWAVE</p><p>24.03.2015 st.alban vorstadt</p><p>#12.1 - We want the funk</p><p>Jeanne Autran</p><p>A move into the Funky and Psychedelic universe of 1970s P-Funk music bands. The 'Funk' is not just a good groove, but it's the fluid of life, the primary dance spirit, the love, the god, as well as the basic concept of an inspired social protest movement. Let's get Funked-up!</p><p>#12.2 -&nbsp;<span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">African new wave dance music</span></p><p><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">Hans Focketyn</span></p><p>In the last 20 years an incredible variety of new music styles, bands and projects has emerged in a similarly diverse amount of African countries. These new music scenes are very specific to the countries where they come from, with music at times based on the combination of traditional elements with electronic instruments, or being simply a very particular evolution of local pop music with an extremely danceable beat. Together, they form the new wave of African dance music.</p>", "type": 0, "id": "c5203481-3995-4f17-bc18-d95299417573", "sortrank": 4},

{"username": "teokmadrid", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1416246090.597}, "content": "The Edge of Knowledge (TEOK) es un ciclo de charlas informales donde temas poco comunes son presentados en el sal\u00f3n de cualquier casa. Las charlas son de corta duraci\u00f3n y se combinan con v\u00eddeos y aperitivos. Los temas son variados; desde la cocina al cosmos, memes en internet o cualquier obsesi\u00f3n personal de los ponentes invitados. <br><span class=\"HOEnZb\"></span><p><br></p><p>Siguiendo la iniciativa ya puesta en marcha en Basilea, continua el evento TEOK Madrid. Este ciclo fue concebido en Basilea a principios del 2014 y comisariado por Juan Palencia, Marta Col\u00f3n y Vera Sacchetti. Persigue ofrecer una mirada alternativa a la producci\u00f3n cultural contempor\u00e1nea y abrir una ventana a todas las personas inquietas con la que compartimos ciudad. <br></p><p><br></p><p>Estamos orgullosos de organizar y promover estos ciclos. Si est\u00e1s por Madrid o pasas por aqu\u00ed, te invitamos a que te unas a estas charlas.</p><p><br></p><p>TEOK Madrid est\u00e1 comisariado por Beatriz Arag\u00f3n, Raquel Buj y Cristina Navas.</p>", "type": 0, "id": "d0b665dd-2ee0-4ea8-b1ec-e1d4f1ba64ec", "sortrank": 1},

{"username": "alexanderhadley+mindrush", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1417690177.162}, "content": "<p>We made MindRush. MindRush is an idea generating game meant as a fun workshop tool to spark creativity. It was made by me and my co-creators during our second project at Hyper Island.</p><p>It is a very simple board game where you throw a numbered dice and take the same amount of steps as the dice shows. You then end up of two of the three colors, being orange, pink and blue. If you end up on blue and orange that would mean that you have to pick up a blue random card (there could be all sorts of weird things on it, eg. dinosaur) and a orange tech trend card (ex. leap motion). You would then have one minute to combine these cards into as many ideas as you can think of. If you land on the \"STEAL IDEA\" square you get to pick one of the other teams ideas and add a category card of the same color as the square. </p><p>The first team to reach the end will choose an idea and then figure out the details around it and make it better as well as preparing a thirty second pitch for their idea. When the last team reaches the goal both teams have three minutes left to finish their idea and pitch. They then pitch it and the most thought out and best idea wins! </p><p>We got great results during and after the workshop. Lots of people ended up asking to use it to generate ideas for their new projects they were starting and we ourselves had a great time playing it!</p>", "type": 0, "id": "ddb2c71b-f634-45c2-b164-b29fa33b62fa", "sortrank": 6},

{"username": "vintagedaydream", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1418350902.008}, "content": "<p></p><p style=\"text-align: left;\"><br></p><p style=\"text-align: left;\">&nbsp;&nbsp;</p><p style=\"text-align: center;\"><b>Sometimes the experience of life itself is difficult.</b></p><p style=\"text-align: left;\"><br></p><p style=\"text-align: left;\">&nbsp; &nbsp; &nbsp;I feel as though it is important to state these things more often,&nbsp;out in the open, where they can be seen and felt and heard and thus transformed in some way.</p><p style=\"text-align: left;\"><br></p><p style=\"text-align: left;\">&nbsp; &nbsp; &nbsp;This is also why I value the moments existing within a cup of tea or a quality conversation, watching the changing of the seasons and experiencing something new. &nbsp;</p><p style=\"text-align: center;\"><p>&nbsp;</p><p style=\"text-align: left;\">&nbsp; &nbsp; &nbsp;I sit in cafes and enjoy being amongst people. If you see me out, feel free to take a seat at the table. The dialogue will arrive as it is intended to be.&nbsp;<span style=\"text-align: center;\">For me, these are the simple joys of living, listening and loving.</span></p><p style=\"text-align: left;\"><br></p><p style=\"text-align: left;\">&nbsp; &nbsp; &nbsp;We can also simply create together. I like to share the supplies. To me, it does not matter if you think you are an artist or not. I like to create for the sake of creating. Sometimes it turns into \"something\" while other times it becomes \"nothing.\" Once you get into the groove, you might like it too.</p><p style=\"text-align: left;\"><br></p><p style=\"text-align: left;\"><p><br></p></p></p><p></p>", "type": 0, "id": "e16c3cc2-98cc-421a-a52a-1db2971a72c8", "sortrank": 8},

{"username": "teok", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1417198334.219}, "content": "<p><b>TEOK #4</b></p><p>VOCAL RANGE &amp; AL\u00c9SIA</p><p>01.07.2014 hammerstrasse Basel</p><p>#4.1 - Complete Voice Technique</p><p>Jasmin Albash</p><p>Singing is not difficult - everybody can sing. Hear about the Complete Voice Technique and develop what kind of sounds your voice is able to do in a healthy way. You\u2019re free to try. The Complete Vocal Technique is a singing method developed by Danish singer, vocal coach and vocal researcher Cathrine Sadolin. Since the 1980s she has been researching all the sounds the human voice is able to produce, coming up with a new terminology and visual representation.</p><p>#4.2 - <a href=\"https://drive.google.com/file/d/0B-tDwevrHDL5eVNDMVM5SGJhTERQMzkycTBKd2ZsZURwMnFn/view?usp=sharing\">Al\u00e9sia: The Jurassienne Hypothesis</a></p><p>Sylvain Baumann &amp; Cristina G\u00e9nova</p><p>The battle of Al\u00e9sia in 52 BC determines the end of the Celtic world and the beginning of Roman rule, but the real location of this battle was never determined\u2026 In 1840, Napoleon III placed Al\u00e9sia in Alise-Sainte-Reine, Burgundy, but in 1962 the site of Chaux-des-Crotenay, in Jura, was discovered to correspond to Caesar\u2019s original description of Al\u00e9sia. Following years of confusion and complication, we trace the many locations, and questions, surrounding the site of Al\u00e9sia.</p>", "type": 0, "id": "ed4b6310-5b57-4a91-a9c2-3cfb4a0245e2", "sortrank": 16},

{"username": "posti.es/by/teoksantiago", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1427314366.877}, "content": "<p>The Edge of Knowledge (TEOK) es un ciclo de charlas informales donde temas poco comunes son presentados en el living de una casa. Las charlas son de corta duraci\u00f3n y se combinan con v\u00eddeos y aperitivos. Los temas son variados; desde la cocina al cosmos, memes en internet o cualquier obsesi\u00f3n personal de los expositores invitados. </p><p><br></p><p>Siguiendo la iniciativa ya puesta en marcha en Basilea, y seguida luego en Madrid, contin\u00faa el evento TEOK Chile. Este ciclo fue concebido en Basilea (Suiza) a principios del 2014, por Juan Palencia, Marta Col\u00f3n y Vera Sacchetti. Persigue ofrecer una mirada alternativa a la producci\u00f3n cultural contempor\u00e1nea y abrir una ventana a todas las personas inquietas con la que compartimos ciudad. </p><p><br></p><p>Estamos orgullosos de organizar y promover estos ciclos, as\u00ed que si est\u00e1s en Santiago de Chile o pasas por aqu\u00ed, te invitamos a que te unas a alguna de nuestras sesiones! </p><p><br></p><p>TEOK Chile es organizado por Tadea Ipi\u00f1a, Alis Arg\u00fcelles y Nicol\u00e1s Miranda.</p><p><br></p><p>CONTACTO / FACEBOOK / MAILING / BASEL / MADRID</p>", "type": 0, "id": "ee23770f-a1f0-4d2f-bca5-4e346f55f3ec", "sortrank": 0},

{"username": "jakob", "created": {"timezone": "+00:00", "$reql_type$": "TIME", "epoch_time": 1425285190.091}, "content": "<p style=\"text-align: center;\"><b><br></b></p><p style=\"text-align: center;\"><b><br></b></p><p style=\"text-align: center;\"><b><br></b></p><p style=\"text-align: center;\"><br></p><p style=\"text-align: center;\"><b>Continue to strike!</b></p><p style=\"text-align: center;\"><b>/Sincerely The Commuters&nbsp;</b></p><p style=\"text-align: center;\">\u2013\u2013\u2013\u2013\u2013\u2013\u2013\u2013\u2013\u2013\u2013\u2013\u2013\u2013\u2013\u2013</p><p style=\"text-align: center;\"><i>Movement</i></p><p style=\"text-align: center;\">During the train driver\u2019s strike in Sweden 2014, the employer\u2019s organization ran a campaign pitting commuters against workers.</p><p style=\"text-align: center;\">&nbsp; &nbsp; I started this <a href=\"https://www.facebook.com/FortsattStrejka\"></a> as a response \u2014 f<span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; letter-spacing: -0.3px; background-color: initial;\">ive days later the train drivers <a href=\"https://translate.google.com/translate?sl=auto&amp;tl=en&amp;js=y&amp;prev=_t&amp;hl=en&amp;ie=UTF-8&amp;u=http%3A%2F%2Fseko.se%2FAktuellt%2FNyheter%2F2014%2FJuni%2FStrejken-avblast--missbruket-av-timanstallningar-stoppat%2F&amp;edit-text=&amp;act=url\"></a>got their demands.&nbsp;</span><span style=\"font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; letter-spacing: -0.3px; line-height: inherit; background-color: initial;\">The campaign gathered 14799 followers on Facebook and media coverage.</span></p>", "type": 1, "id": "ffee4e17-c09c-45eb-873a-7b44089fced8", "sortrank": 29}]</script>
